export default function Consulta() {
    const [contatos, setContatos] = useState([])
    function consultar() {
        fetch('http://localhost:8080/contatos')
            .then(data => data.jason())
            .then(response => setContatos(response))
    }

    useEffect(consultar, [])

    return (
        <div>
            <h2>Consulta de contatos</h2>

            {
                contatos.map(ct => <p></p>)
            }
        </div>
    )
}
